import react from "react";
import "./details.css";
function Details(Props) {
    let num = 0;
    return (
        <div className="detailContainer">
            <div className="detailCard">
                <div className="images">
                    <div className="littleimages">
                        {Props.item.images.map((item) => {
                            return <img src={item} className="littleImages" />;
                        })}
                    </div>
                    <img src={Props.item.images[num]} />
                </div>
                <div className="detailWrapper">
                    <div className="details detailItem">
                        <p className="name">{Props.item.name}</p>
                        <p className="des">{Props.item.description}</p>
                        <p className="price mb0">{Props.item.price}Rs</p>
                    </div>
                    <div className="buy detailItem">
                        <button>Buy</button>
                        <button>Add to cart</button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Details;
